  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains swath bathymetric
  data collected during USGS cruise 06FSH01 aboard the R/V G.K. Gilbert. A side scan
  sonar, bathymetric, and high-resolution seismic-reflection survey was conducted
  off Sarasota, FL to describe the relationship between the sediments and morphology
  of the inner shelf and adjacent shoreface. These data are part of the Florida Shelf
  Habitat (FLaSH) map project. For more information on the seismic surveys see http://walrus.wr.usgs.gov/infobank/g/g106fl/html/g-1-06
  -fl.meta.html These data are also available via GeoMapApp (http://www.geomapapp.org/)
  and Virtual Ocean ( http://www.virtualocean.org/) earth science exploration and
  visualization applications.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
